import React, { useEffect, useState } from "react";
import searchIcon from "../../resources/images/search-icon.svg"
import controlsIcon from "../../resources/images/controls-icon.svg"
import exportIcon from "../../resources/images/export-icon.svg"
import filterIcon from "../../resources/images/filter-icon.svg"


export const QuoteLibrary = () => {
    const [quotes, setQuotes] = useState(
        //placeholder state until we get a working fetch going
        [
            { "id": 1, "quoteDate": "mm/dd/yyy", "case": "After cataract laser...", "patient": "Finelli, Michael", "dob": "mm/dd/yyyy", "primaryPayer": "", "surgicalCPT": "", "anesthesiaCPT": "", "group": "000000", "amtDue": "1000", "provider": "", "creator": "Finelli" },
            { "id": 2, "quoteDate": "mm/dd/yyy", "case": "After cataract laser...", "patient": "Finelli, Michael", "dob": "mm/dd/yyyy", "primaryPayer": "", "surgicalCPT": "", "anesthesiaCPT": "", "group": "000000", "amtDue": "1000", "provider": "", "creator": "Finelli" },
            { "id": 3, "quoteDate": "mm/dd/yyy", "case": "After cataract laser...", "patient": "Finelli, Michael", "dob": "mm/dd/yyyy", "primaryPayer": "", "surgicalCPT": "", "anesthesiaCPT": "", "group": "000000", "amtDue": "1000", "provider": "", "creator": "Finelli" },
            { "id": 4, "quoteDate": "mm/dd/yyy", "case": "After cataract laser...", "patient": "Finelli, Michael", "dob": "mm/dd/yyyy", "primaryPayer": "", "surgicalCPT": "", "anesthesiaCPT": "", "group": "000000", "amtDue": "1000", "provider": "", "creator": "Finelli" },

        ]
        )

    async function getQuotes() {
        let url = 'http://whatever/'
        let config = {}
        const response = await fetchQuotes();
        console.log(response)
    }

    const fetchQuotes = () => {
        return fetch("http://localhost:1234/quotes")
          .then(res => res.json())
      };

    // useEffect(() => {
    //     //add fetch here
    //     getQuotes(), [quotes]
    // })

    return (
        <>
        <div className="table-container">
            <div className="table-title">Quotes</div>
            <div className="table-header">
                <img src={filterIcon}/>
                <div className="table-search">
                    <img src={searchIcon}/>
                    <input placeholder="Search Placeholder Text"></input>
                    <img src={controlsIcon}/>
                    <img src={exportIcon}/>
                    <button className="table-new-btn">Co-Provider Quote +</button>
                </div>
            </div>
            <p>This is the table</p>
            <th className="quotes-table">
                {/* {
                    quotes.map(quote => {
                        return <>
                            <div>Quote</div>
                            <div>{quote.id}</div>
                            <div>{quote.quoteDate}</div>
                            <div>{quote.case}</div>
                            <div>{quote.patient}</div>
                        </>
                        
                    })
                } */}
                {
                    Object.keys(quotes.object).map((key, i) => {
                        <>
                        <div>{key}</div>
                        <div>{quotes.object[key]}</div>
                        </>
                    })
                }
            </th>
        </div>
        </>
    )
}
